import React from 'react';

const styles={
    h1: {
        marginTop: '25vh',
        color: 'lightgrey',
    },
    button: {
        // color: 'grey',
        // padding: '1%',
        backgroundColor: 'inherit',
        // borderColor: 'grey'
         display:"inline-block",
         padding:"0.35em 1.2em",
         border:"0.1em solid lightgrey",
         margin:"0 0.3em 0.3em 0",
         borderRadius:"0.12em",
         boxSizing: "border-box",
         textDecoration:"none",
         fontWeight:"300",
         color:"lightgrey",
         textAlign:"center",
         transition: "all 0.2s",

    }
}

const Newlanding = () => {

    return(

        <>
        <br></br>        
        <center>
            <h1 style={styles.h1}>Chase Lipscomb Web Developer</h1>
            <button style={styles.button}
                onMouseOut={({target})=>target.style.color='lightgrey'}
                onMouseOver={({target})=>{
                    target.style.color='yellow'
                    target.style.bordercolor='yellow'
                    }}>View Work</button>
            </center>
        </>

    )
}
export default Newlanding
